import React from "react";

import {List} from "reactstrap";

const ClientList = ({data}) => {
    return ( 
        <div >
    
                {
                    (data.length < 1) ? (
                        <h1> No hay datos disponibles </h1>
                    )
                    :
                    (
                        data.map((item) => (
                        <List>
                          <li>
                            {item.nombre}
                          </li>
                          <li>
                            {item.username}
                          </li>
                          <li>
                            {item.descripcion}
                          </li>
                        </List>
                        ))
                    )
                }
    
        </div>
        )
}

export default ClientList
